  `id_tipo` int(10) unsigned DEFAULT '1',
  `url_pdf` varchar(500) DEFAULT '',
  `url_xml` varchar(500) DEFAULT '',
  PRIMARY KEY (`id_aseguradora`,`expediente`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;
